import { useParams } from 'react-router-dom'
import Navbar from './navbar'
// import Content from './content'
import { CardContent } from './data'


function Details({data}){
    const {id} = useParams();

    return(
        <>
            <Navbar />
            {data.filter((card) => card.id === id).map((card) => (
                <div key={card.id}>
                    <h1>{card.tittle}</h1>
                    <h1>{card.tittle}</h1>
                </div>
            ))}

        </>
    )
}

export default Details
